INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 0, 24, "あたしだって\nやるときはやるよ！", 0.0, 1, "2030/12/17 14:59:59", 0.0, 24001, 0.0, 102601, "リン", 1, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 1, 24, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 1, "2030/12/17 14:59:59", 0.0, 24002, 0.0, 102601, "リン", 1, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 2, 24, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 1, "2030/12/17 14:59:59", 0.0, 24003, 0.0, 102601, "リン", 1, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 3, 24, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 2, "2030/12/17 14:59:59", 0.0, 24004, 0.0, 102601, "リン", 2, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 4, 24, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 1, "2030/12/17 14:59:59", 0.0, 24005, 0.0, 102601, "リン", 1, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 5, 24, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 2, "2030/12/17 14:59:59", 0.0, 24006, 0.0, 102601, "リン", 2, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 6, 24, "あたしも意外と\nやるもんでしょ？", 0.0, 2, "2030/12/17 14:59:59", 0.0, 24007, 0.0, 102601, "リン", 2, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 7, 24, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 4, "2030/12/17 14:59:59", 0.0, 24008, 0.0, 102601, "リン", 4, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 8, 24, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 4, "2030/12/17 14:59:59", 0.0, 24009, 0.0, 102601, "リン", 4, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 9, 24, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 4, "2030/12/17 14:59:59", 0.0, 24010, 0.0, 102601, "リン", 4, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 10, 24, "やられた…\nねずみって意外と\nてごわいね", 0.0, 4, "2030/12/17 14:59:59", 0.0, 24011, 0.0, 102601, "リン", 4, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 11, 24, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 4, "2030/12/17 14:59:59", 0.0, 24012, 0.0, 102601, "リン", 4, 10040);
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES ("2020/04/30 12:00:00", 12, 24, "疲れた…\nけど、次こそは\n守り抜くよ…", 1.81, 4, "2030/12/17 14:59:59", 0.0, 24013, 0.0, 102601, "リン", 1, 10040);
